CREATE TABLE IF NOT EXISTS venue (
                                     venue_id SERIAL PRIMARY KEY,
                                     venue_name varchar(50) UNIQUE,
                                     address TEXT,
                                     city varchar(20),
                                     country varchar(20),
                                     postal_code varchar(10),
                                     longitude float,
                                     latitude float,
                                     timezone varchar(30)
);
​
CREATE TABLE IF NOT EXISTS attraction (
                                          attraction_id SERIAL PRIMARY KEY,
                                          attraction_name varchar(50) UNIQUE,
                                          attraction_type varchar(30),
                                          url TEXT,
                                          image_url TEXT
);
​
CREATE TABLE IF NOT EXISTS events (
                                      event_id SERIAL PRIMARY KEY,
                                      event_name varchar(80), -- UNIQUE,
                                      local_date date,
                                      local_time time,
                                      event_type varchar(50),
                                      promoter varchar(30),
                                      image_url TEXT,
                                      please_note TEXT,
                                      venue_id SERIAL REFERENCES venue(venue_id), --FOREIGN KEY
                                      attraction_id SERIAL REFERENCES attraction(attraction_id), --FOREIGN KEY
                                      is_active boolean,
                                      thumbs_up int,
                                      thumbs_down int
);
​
CREATE TABLE IF NOT EXISTS itinerary (
                                         itinerary_id SERIAL PRIMARY KEY,
                                         itinerary_name varchar(50),
                                         min_total_price integer,
                                         max_total_price integer
);
​
CREATE TABLE IF NOT EXISTS genre (
                                     genre_id SERIAL PRIMARY KEY,
                                     genre_name varchar(20) UNIQUE
);
​
CREATE TABLE IF NOT EXISTS personItinerary (
                                               itinerary_id SERIAL PRIMARY KEY REFERENCES itinerary(itinerary_id), --FOREIGN KEY
                                               person_id SERIAL REFERENCES person(person_id) --FOREIGN KEY
);
​
CREATE TABLE IF NOT EXISTS personEvent (
                                           event_id SERIAL PRIMARY KEY REFERENCES events(event_id), --FOREIGN KEY
                                           person_id SERiAL REFERENCES person(person_id) --FOREIGN KEY
);
​
CREATE TABLE IF NOT EXISTS itineraryEvent (
                                              itinerary_id SERIAL PRIMARY KEY REFERENCES itinerary(itinerary_id), --FOREIGN KEY
                                              event_id SERIAL REFERENCES events(event_id) --FOREIGN KEY
);
​
CREATE TABLE IF NOT EXISTS eventGenre (
                                          event_id SERIAL PRIMARY KEY REFERENCES events(event_id), --FOREIGN KEY
                                          genre_id SERIAL REFERENCES genre(genre_id) --FOREIGN KEY
);
​
CREATE TABLE IF NOT EXISTS personGenre (
                                           genre_id SERIAL PRIMARY KEY REFERENCES genre(genre_id), --FOREIGN KEY
                                           person_id SERIAL REFERENCES person(person_id) --FOREIGN KEY
);



